// MORE WHITE

import React from 'react';
import AccountDetails from '../shared/accountDetails';
import TransactionHistory from '../shared/transactionHistory';
import WithdrawDeposit from '../shared/moneyTransfer';
import 'bootstrap/dist/css/bootstrap.min.css';
//import '../Dashboard.css';

export default function CustomerDashboard() {
    const customerAccountId = '123456789'; // This should be dynamically set to the logged-in customer's account ID

    return (
        <div className="container-fluid py-4" style={{ backgroundColor: '#f0f8ff' }}>
            <div className="row justify-content-center">
                <div className="col-lg-4 col-md-6 mb-4">
                    <div className="card custom-card shadow-sm h-100">
                        <div className="card-body">
                            <AccountDetails />
                        </div>
                    </div>
                </div>
                <div className="col-lg-4 col-md-6 mb-4">
                    <div className="card custom-card shadow-sm h-100">
                        <div className="card-body">
                            <TransactionHistory customerAccountId={customerAccountId} />
                        </div>
                    </div>
                </div>
                <div className="col-lg-4 col-md-6 mb-4">
                    <div className="card custom-card shadow-sm h-100">
                        <div className="card-body">
                            <WithdrawDeposit />
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
}
